import React from 'react';

const Card= () =>{
	return(
		<div>
			<img src='https://robohash.org/test' alt='game' />
			<div>
				<h2>Valorant</h2>
				<p>Rating 4.6</p>
			</div>
		</div>
	);
}

export default Card;
